// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.6.12;

import {ChangeContract} from "../moc-governance/Governance/ChangeContract.sol";
import {IRegistry} from "../IRegistry.sol";
import {RegistryConstants} from "../RegistryConstants.sol";

/**
  @title MocFlowRegistryInitChange
  @notice This contract is a ChangeContract intended to initialize all the MOC Flow registry values
 */
contract MocFlowRegistryInitChange is ChangeContract, RegistryConstants {
    IRegistry public registry;
    address[] public buffers;
    address[] public drippers;
    address[] public coiners;
    address[] public reverseAuctions;

    /**
      @notice Constructor
    */
    constructor(
        IRegistry _registry,
        address[] memory _buffers,
        address[] memory _drippers,
        address[] memory _coiners,
        address[] memory _reverseAuctions
    ) public {
        registry = _registry;
        buffers = _buffers;
        drippers = _drippers;
        coiners = _coiners;
        reverseAuctions = _reverseAuctions;
    }

    /**
      @notice Execute the changes.
      @dev Should be called by the governor, but this contract does not check that explicitly because it is
      not its responsability in the current architecture
     */
    function execute() external override {
        require(address(registry) != address(0), "Use once");
        registry.pushAddressArray(MOC_FLOW_BUFFERS, buffers);
        registry.pushAddressArray(MOC_FLOW_DRIPPERS, drippers);
        registry.pushAddressArray(MOC_FLOW_COINERS, coiners);
        registry.pushAddressArray(MOC_FLOW_REVERSE_AUCTIONS, reverseAuctions);
        // usable just once!!!
        registry = IRegistry(0);
    }
}

